import React from "react";
import { Link } from "react-router-dom";
import "./PortfolioNav.css";
import { BrowserRouter as  Route, Switch } from "react-router-dom";
import WebProject from "../WebDevelopment/WebDevelopment"

const PortNav = props => (
  <div>
    <div className="navbar z-depth-3">
      <Link to="/web">{props.button1} </Link>{" "}
      <Link to="/portfolio"> {props.button2}</Link>{" "}
      <Link to="/home"> {props.button3}</Link>{" "}
    </div>

    <Switch>
      <Route path="/web" component={WebProject} />
      <Route path="/webproject" component={WebProject} />
      <Route path="/development" component={WebProject} />
      {/* <Route path="/home" component={Home} /> */}
    </Switch>
  </div>
);

export default PortNav;
